import React from "react";
import {Switch, BrowserRouter, Route} from "react-router-dom";
import GetFibNum from "./components/GetFibNum.js";
import GetHistOfReq from "./components/GetHistOfReq.js";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Route exact path="/"><Redirect to="/Fibbonnacci" component={GetFibNum} /></Route>
      <Route path="/history" component={GetHistOfReq} />
    </BrowserRouter>
  );
}

export default App;
